import React from "react";

function Header() {
  return (
    <div className="container">
      <section className="jumbotron">
        <div className="text-center">
          <h1>
            Welcome to <span>My Community!</span>
          </h1>
        </div>
      </section>
    </div>
  );
}

export default Header;
